	background: url("http://www.rakuten.ne.jp/gold/kintsu/images/cart04.png") no-repeat;
	/*border: 1px solid #930;*/
	border: 0;
	height: 45px;
	text-indent: -9999px;
	cursor: pointer !important;
	width: 250px;
	margin-top: 10px;
	display: block;
}
input[value="買い物かごに入れる"]:not(:target) {
	background-size: cover\9; /* IE9 */
	height: 45px\9;
	width: 250px\9;
}

@media screen and (-ms-high-contrast: active), (-ms-high-contrast: none) {
input[value="買い物かごに入れる"] {
	background-size: cover;     /* IE10 */
	height: 45px;
	width: 250px;
}
}
input[value="買い物かごに入れる"]:hover {
	opacity: 0.8;
}
/***「お問合せ」ボタン***/
font input[value="商品についての問合わせ"] {
